import React from "react";
import './header.css';

class Header extends React.Component{
    render() {
        return(
            <div className="headerContainer">
                <img className="imageLogo" src="../../assets/logo/diandika_logo.jpg" alt="logo"/>
            </div>
        )
    }
}

export default Header;
